  \ IO. Please wrap your code answer using ```:\nYou have a large rectangular board\
  \ which is divided into n \xD7 m cells (the board has n rows and m columns). Each\
  \ cell is either white or black.\n\nYou paint each white cell either red or blue.\
  \ Obviously, the number of different ways to paint them is 2^w, where w is the number\
  \ of white cells.\n\nAfter painting the white cells of the board, you want to place\
  \ the maximum number of dominoes on it, according to the following rules:\n\n  *\
  \ each domino covers two adjacent cells; \n  * each cell is covered by at most one\
  \ domino; \n  * if a domino is placed horizontally (it covers two adjacent cells\
  \ in one of the rows), it should cover only red cells; \n  * if a domino is placed\
  \ vertically (it covers two adjacent cells in one of the columns), it should cover\
  \ only blue cells. \n\n\n\nLet the value of the board be the maximum number of dominoes\
  \ you can place. Calculate the sum of values of the board over all 2^w possible\
  \ ways to paint it. Since it can be huge, print it modulo 998 244 353.\n\nInput\n\
  \nThe first line contains two integers n and m (1 \u2264 n, m \u2264 3 \u22C5 10^5;\
  \ nm \u2264 3 \u22C5 10^5) \u2014 the number of rows and columns, respectively.\n\
  \nThen n lines follow, each line contains a string of m characters. The j-th character\
  \ in the i-th string is * if the j-th cell in the i-th row is black; otherwise,\
  \ that character is o.\n\nOutput\n\nPrint one integer \u2014 the sum of values of\
  \ the board over all 2^w possible ways to paint it, taken modulo 998 244 353.\n\n\
  Examples\n\nInput\n\n\n3 4\n**oo\noo*o\n**oo\n\n\nOutput\n\n\n144\n\n\nInput\n\n\
  \n3 4\n**oo\noo**\n**oo\n\n\nOutput\n\n\n48\n\n\nInput\n\n\n2 2\noo\no*\n\n\nOutput\n\
  \n\n4\n\n\nInput\n\n\n1 4\noooo\n\n\nOutput\n\n\n9\nA: ```mod = 998244353\nm,n =\
  \ map(int,input().split())\nmat = [[0]*n for _ in range(m)]\nt = 0\nres = 0\ncom\
  \ = [0] * (max(m,n) + 2)\ncom[2] = 1\npow2 = 1\nfor i in range(3,max(m,n)+1):\n\
  \    pow2 = (pow2 << 1) % mod\n    com[i] = (com[i-1] + 2*com[i-2] + pow2) % mod\n\
  \    \nfor i in range(m):\n    s = input()\n    for j in range(n):\n        if s[j]\
  \ ==\"o\":\n            mat[i][j] = 1\n            t += 1\n\nfor i in range(m):\n\
  \    count = 0\n    for j in range(n):\n        if mat[i][j] == 1:\n           \
  \ count += 1\n        else:\n            if count >= 2:\n                res = (res\
  \ + pow(2,t-count,mod) * com[count] ) % mod\n            count = 0\n    if count\
  \ >= 2:\n        res = (res + pow(2,t-count,mod) * com[count] ) % mod\n        \
  \    \n\nfor j in range(n):\n    count = 0\n    for i in range(m):\n        if mat[i][j]\
  \ == 1:\n            count += 1\n        else:\n            if count >= 2:\n   \
  \             res = (res + pow(2,t-count,mod) * com[count] ) % mod\n           \
  \ count = 0\n    if count >= 2:\n        res = (res + pow(2,t-count,mod) * com[count]\
  \ ) % mod \n\nprint(res)```\nQ: Write python code to solve the following coding\
